import axios from 'axios';
const Post = ({id}) => {
  return (
    <h1>Post page at post {id}</h1>
  )
}

Post.getInitialProps = async ({ query }) => {
  console.log(query)
  const { data } = axios.get(`http://jsonplaceholder.typicode.com/comments?postId=${query.id}`)

  console.log('data', data)

  return { id: 1 }

  return data
}

export default Post
